import React, { Component } from "react";
import products from "../products.json";

class Products extends Component {
  constructor() {
    super();
    this.state = {
      products:products 
    };
  }

  render(){
      return(
          <div>
              this.state.products.map( product => {
                  <h3>product.name</h3>
              })
          </div>
      )
  }
}

export default Products;
